import React, { Component } from 'react';

class Deal extends Component {
    render() {
        return (
            <div className='c'>
                <span>Buy Date</span>
                <p>13th April</p>
                <span>Sell Date</span>
                <p>17th April</p>
            </div>
        );
    }
}

export default Deal;
